import Vue from 'vue'
import Router from 'vue-router'
import Home from './views/Home.vue'
import DashaUtyuzh from './views/DashaUtyuzh.vue'
import About from './views/About.vue'
import DropdownList from './views/DropdownList'

Vue.use(Router)

export default new Router({
  routes: [
    {
      path: '/',
      name: 'home',
      component: Home
    },
    {
      path: '/about',
      name: 'about',
      component: About
    },
    {
      path: '/dropdownlist',
      name: 'dropdownlist',
      component: DropdownList
    },
    {
      path: '/dashautyuzh',
      name: 'dashautyuzh',
      component: DashaUtyuzh
    }
  ]
})
